package net.jeeshop.services.front.keyvalue.bean;import java.io.Serializable;public class Keyvalue extends net.jeeshop.services.common.Keyvalue implements Serializable {	private static final long serialVersionUID = 1L;	private String id;	private String key1;	private String value;	@Override	public void clear() {		super.clear();		id = null;		key1 = null;		value = null;	}	@Override	public String getId() {		return id;	}	@Override	public void setId(String id) {		this.id = id;	}	@Override	public String getKey1() {		return key1;	}	@Override	public void setKey1(String key1) {		this.key1 = key1;	}	@Override	public String getValue() {		return value;	}	@Override	public void setValue(String value) {		this.value = value;	}}